function ExecutiveForm() {
    const fields = [
        {
            label  : "Name", 
            name : "Name" ,
            type : " text"
        },
        {
            label  : "Phone Number", 
            name : "PhoneNo" ,
            type : " number"
        },
        {
            label  : "Address", 
            name : "Address" ,
            type : " text"
        },
        {
            label  : "Email", 
            name : "Email" ,
            type : " text"
        },
        {
            label  : "Occupation", 
            name : "Occupation",
            type : " text"
        },
        {
            label  : "Aadhar Number", 
            name : "AadharNo" ,
            type : " text"
        }
    ]
  return (
    <div className="bg-white rounded-md">
      <form className="flex flex-col text-left">
      {
          fields.map(el=>{
              return(
                  <div className="flex flex-row  justify-around text-right">
                  <div className="">
                <label >
                {el.label}
                </label> 
                </div>
                <div className="">
                <input className="bg-lightgray " type={el.type} name={el.name} />
                </div>

              </div>
              )
          })
      }



        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}

export default ExecutiveForm;
